import React from "react";
import "./index.css";
import HTML from './img/HTML.png'
import CSS from './img/CSS.png'
import react from './img/react.png'
import js from './img/javascript.png'
import njs from './img/nodejs.png'
import mdb from './img/mongodb.png'
import ex from './img/express.png'
import vstudio from './img/visualstudio.png'
import github from './img/github.png'
import py from './img/python.png'
import { Col, Row } from 'react-grid-system';

const Skills = () => {
  const skills = [
    { image: {py} },
    { image: {js} },
    { image: {HTML} },
    { image: {CSS} },
    { image: {Bootstrap} },
    { image: {mdb} },
    { image: {ex} },
    { image: {react} },
    { image: {njs} },
    { image: {vstudio} },
    { image: {github} }
  ];

  return (
    <div className="skills-container">
      <Row>
        {skills.map((skill, index) => (
          <Col key={index} xs={6} sm={4} md={3} lg={2}>
            <img src={require(`${skill.image}`)} alt={`Skill ${index + 1}`} className="skill-image" />
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default Skills;
